import React, { Component } from 'react'
import { Container, Row, Col } from 'reactstrap';
import { Link } from 'react-router-dom';

class Visit extends Component {
	constructor(props) {
		super(props);
	}

	// This will loop through the records adding them to the eventually outputted output array
	getRecords = () => {
		let output = [];
		let first = true; // the first one is one style short of the remaining

		// Keep lopping
		this.props.visitRecord.records.forEach((record)=>{
			if(record.type=='visit'){
				output.push(<Col>{record.activity}</Col>)
			}

			output.push(				<pre>{JSON.stringify(this.props.visitRecord,null,2)}</pre>)


			console.log('the record is ',record)

			// it's no longer the first
			first = false;
		})


		// First lest combine the visits and violations into a single tt1

		// Loop through the visits first, since there is probably only ever going to be one of them
		// this.props.visitRecord.visitIDs.forEach((record)=>{this.recordDetails(record,'visit',first)})
		// this.props.visitRecord.violationIDs.forEach((record)=>{this.recordDetails(record,'violation',first)})


		return output;
	}

	recordDetails = (id,type) => {
		console.log('record details ',id,type)
	}

	render(){
		return (<Row className={(this.props.visitRecord.hasViolation?'violation':'')}>
			<Col>{this.props.visitRecord.date}</Col>
			{this.getRecords()}
		</Row>)
	}
}

export default Visit;

